import React from 'react';
import MovieCard from './MovieCard';
import './App.css';

const MovieList = ({ movies }) => {
    return (
        <div className="movie-list">
            {movies.length > 0 ? (
                movies.map(movie => (
                    <MovieCard key={movie.id} movie={movie} />
                ))
            ) : (
                <p>No movies available at the moment.</p>
            )}
        </div>
    );
};

export default MovieList;
